import React from 'react';
import GymCards from '../../Ui/Cards/GymCards';

const DataGym = () => {
    const data = [
        {
            imagen: 'https://res.cloudinary.com/duxhiuugx/image/upload/v1685650763/Imagen01_n6czw7.jpg',
            name: 'Smart Power Gym',
            place: 'Tesalónica Apartamentos, Cl. 23 #37-25, Armenia, Quindío'
        }
    ]

    return (
        <div>
            <div className='gymCards'>
                {data.map((cards, index) => (
                    <GymCards 
                        key={index}
                        imagen={cards.imagen}
                        name={cards.name}
                        place={cards.place}
                    />
                ))}
            </div>
        </div>
    )
}

export default DataGym;
